from sympy import primeomega
def test(n):
    if n<2: return n-1
    return primeomega(n)
def a(n):
    tests = [test(i) for i in range(n+1)]
    return sum(2**tests.count(v)-1 for v in set(tests))
print([a(n) for n in range(60)]) # _Michael S. Branicky_, Dec 07 2020

